import React from 'react';
import Footer from "../components/Footer";
import NavBar from "../components/NavBar";
import Page404 from "./404";

const AboutPage = () => {
    return (
        <div className="container">
            <NavBar/>
                <Page404/>
            <Footer/>
        </div>
    );
};

export default AboutPage;
